import unittest
import model.order as order
import model.db_connection as db_connection


class OrderTestCase(unittest.TestCase):

    def test_get_all_orders(self):
        result = order.get_all_orders()
        self.assertIsNotNone(result)

    def test_get_order_details_for_correct_user(self):
        result = order.get_order_details_for_user('test@gmail.com')
        self.assertIsNotNone(result)

    def test_get_order_details_for_incorrect_user(self):
        result = order.get_order_details_for_user('test1@gmail.com')
        self.assertEqual(len(result), 0)

    def tearDown_for_add_to_cart(self, order_id):
        connection = db_connection.get_connection()
        with connection.cursor() as cursor:
            sql = "DELETE from CUSTOMER_ORDER where `ID`=%s"
            cursor.execute(sql, order_id)
            connection.commit()

    def test_add_to_cart(self):
        result, order_id = order.add_to_cart('1', 'data:image/png;base64,', '3', '2', '2', 'test@gmail.com', '99.99')
        self.assertEqual(result, 1)
        self.tearDown_for_add_to_cart(order_id)

    def test_load_cart_correct(self):
        result = order.load_cart('test@gmail.com')
        self.assertIsNotNone(result)

    def test_load_cart_incorrect(self):
        result = order.load_cart('test1@gmail.com')
        self.assertEqual(len(result), 0)

    def test_get_order_details_by_id_correct(self):
        result = order.get_order_details_by_id('85')
        self.assertEqual(result['ID'], 85)

    def test_get_order_details_by_id_incorrect(self):
        result = order.get_order_details_by_id('20')
        self.assertEqual(result, None)

    def setUp_for_update_order_status_for_order(self):
        connection = db_connection.get_connection()
        with connection.cursor() as cursor:
            sql = "INSERT INTO CUSTOMER_ORDER(`ID`,`product_id`,`user_id`,`email_id`,`woodtype_id`,`woodpattern_id`," \
                      "`total_cost`,`state`,`order_date`,`quantity`,`Order_Id`,`image`) VALUES('2','1', '45', 'test@gmail.com', '2', '2', '12.99'," \
                      "'In Cart', '2020-04-23', '3', '1', '') "
            cursor.execute(sql)
            connection.commit()

    def tearDown_for_update_order_status_for_order(self):
        connection = db_connection.get_connection()
        with connection.cursor() as cursor:
            sql = "DELETE from CUSTOMER_ORDER where `ID`='2'"
            cursor.execute(sql)
            connection.commit()

    def test_update_order_status_for_order_correct(self):
        self.setUp_for_update_order_status_for_order()
        result = order.update_order_status_for_order('Order Received', '2')
        self.assertEqual(result, 1)
        self.tearDown_for_update_order_status_for_order()

    def test_update_order_status_for_order_incorrect(self):
        result = order.update_order_status_for_order('Order Received', '20')
        self.assertEqual(result, 0)

    def setUp_for_remove_cart(self):
        connection = db_connection.get_connection()
        with connection.cursor() as cursor:
            sql = "INSERT INTO CUSTOMER_ORDER(`ID`,`product_id`,`user_id`,`email_id`,`woodtype_id`,`woodpattern_id`," \
                      "`total_cost`,`state`,`order_date`,`quantity`,`Order_Id`,`image`) VALUES('2','1', '45', 'test@gmail.com', '2', '2', '12.99'," \
                      "'In Cart', '2020-04-23', '3', '1', '') "
            cursor.execute(sql)
            connection.commit()

    def test_remove_cart_correct(self):
        self.setUp_for_remove_cart()
        result = order.remove_cart('2')
        self.assertEqual(result, 1)

    def test_remove_cart_incorrect(self):
        result = order.remove_cart('2')
        self.assertEqual(result, 0)

    def setUp_for_place_order(self):
        connection = db_connection.get_connection()
        with connection.cursor() as cursor:
            sql = "INSERT INTO CUSTOMER_ORDER(`ID`,`product_id`,`user_id`,`email_id`,`woodtype_id`,`woodpattern_id`," \
                  "`total_cost`,`state`,`order_date`,`quantity`,`Order_Id`,`image`) VALUES('5','1', '45', 'test@gmail.com', '2', '2', '12.99'," \
                  "'In Cart', '2020-04-23', '3', '1', '') "
            cursor.execute(sql)
            connection.commit()

    def tearDown_for_place_order(self, order_id):
        connection = db_connection.get_connection()
        with connection.cursor() as cursor:
            sql = "DELETE from CUSTOMER_ORDER where `Order_Id`=%s"
            cursor.execute(sql, order_id)
            sql1 = "DELETE from ORDERS where `Order_id`=%s"
            cursor.execute(sql1, order_id)
            connection.commit()

    def test_place_order(self):
        self.setUp_for_place_order()
        result, order_id = order.place_order('test@gmail.com', '29.99', 'college ave, tempe, az', '85281', '1234567890', '2024-04-04', '123', '9898989898')
        self.assertEqual(result, 1)
        self.tearDown_for_place_order(order_id)

if __name__ == '__main__':
    unittest.main()
